!function(){const e=new URLSearchParams(window.location.search).get("uid"),o=new FormData;o.append("uid",e),fetch("api/checkout/stripe-session",{method:"post",headers:{"Content-Type":"application/x-www-form-urlencoded"},body:new URLSearchParams(o)}).then((e=>e.json())).then((e=>{console.log(e),e.status?window.location.replace("/login"):console.log("Payment failed.")}))}();